import {Service,Service2} from './config.js'


const get = (config) => {
    return Service({
        ...config,
        method: 'get',
        params: config.data
    })
}

const post = (config) => {
    return Service({
        ...config,
        method: 'post',
        data: config.data
    })
}
const post2 = (config) => {
    return Service2({
        ...config,
        method: 'post',
        data: config.data
    })
}


export default {
    get,
    post,
    post2,
}
